    var diff, target;
    target = e.layerX + 10;
    diff = target + this.alt.clientWidth - window.innerWidth + 5;
    if (diff >= 0) target -= diff;
    if (target <= 0) target = 5;
    this.alt.style.left = target;
    target = 225 + e.layerY + 20;
    diff = target + this.alt.clientHeight - window.innerHeight + 5;
