canvas.app.clanWar.view.UsersList.prototype.sortByTitle = function (a, b) {
    if (a.voivoda != b.voivoda) {
        return a.voivoda ? -1 : 1;
    } else if (a.login > b.login) {
        return 1;
    } else if (a.login < b.login) {
        return -1;
    } else {
        return 0;
    }
};
