    this.rad = 19;
    var rad = this.rad;
    this.har = [
        [rad, -rad],
        [rad, rad],
        [-rad, rad],
        [-rad, -rad],
        [0, -rad],
    ];
    this.shp = new canvas.px.Graphics();
